import React from 'react';
import {Products} from '../Datas';

export default function ProductsPage() {

    const products = Products;
    console.log("products:",products);
  return (
    <>
    <div>Products</div>
    <div class="right-container">
           <div class="row row-cols-1 row-cols-md-4">
            
               {products.map((product,i)=>(

                 <a class="col mb-4" asp-action="DisplayProduct" asp-route-Id="@item.ProductId">
                       <div class="card h-20">
                           <img src="@item.ImageUrl" class="card-img-top" height="250px" width="auto" alt="@item.Name"/>
                           <div class="card-body">
                               <h6 class="card-title">@item.Name</h6>
                               <p class="card-text">Rs. @item.Cost.ToString("0")</p>
                           </div>
                       </div>
                   </a>
                     ))
               }
           </div>
       </div>
    </>
  )
}
